import React, { FC, useState } from "react";
import NoNavLayout from "../../components/Layouts/NoNavLayout";
import { useKeyboardForm } from "../../lib/keyboardFormStore";
import { Flex } from "@rsbear/betsy";

const CreateKeyboard: FC<any> = () => {
  const [steps, setSteps] = useState({ one: true, two: false, three: false });
  const { values, changeStringInArray, setString } = useKeyboardForm();

  async function onSubmit() {
    event?.preventDefault();
    console.log("values", values);
  }

  return (
    <NoNavLayout>
      <h1>Create Keyboard</h1>
      <Flex>
        <div>part one --- </div>
        <div>part two --- </div>
        <div>part three</div>
      </Flex>
      <form onSubmit={onSubmit}>
        <p>name & brand</p>
        <Flex>
          <input
            type="text"
            placeholder="Name"
            name="name"
            value={values.name}
            onChange={(e) => setString(e)}
          />
          <input
            type="text"
            placeholder="brand"
            name="brand"
            value={values.brand}
            onChange={(e) => setString(e)}
          />
        </Flex>

        <p>extra plates</p>

        <input
          type="text"
          placeholder="colors"
          value={values.colors[0]}
          tabIndex={0}
          onChange={(e) => changeStringInArray(e, e.target.value)}
        />
        <button type="submit">submit</button>
      </form>
    </NoNavLayout>
  );
};

export default CreateKeyboard;
